	(2, '2023-09-17 07:49:42.000000', '2023-09-17 07:49:42.000000', '양식 설정', '인텔(소켓1700) / 10nm / 6코어 / 12쓰레드 / 기본 클럭: 2.5GHz / 최대 클럭: 4.4GHz / L3 캐시: 18MB / TDP: 65W /메모리 규격: DDR4 / 3200MHz /DDR5 / 4800MHz / 내장그래픽: 미지원 / 12세대 엘더레이크 / 코어 i5 / 헥사(6) 코어 / LGA 1700 / 박스 (쿨러포함) / 12MB 이상 / 내장그래픽 미포함', '[INTEL] 코어12세대 i5-12400F 정품박스', 194000, 'cpu'),
	(3, '2023-09-17 07:49:42.000000', '2023-09-17 07:49:42.000000', '양식 설정', 'AMD(소켓AM4) / 4세대 (Zen 3) / 7nm / 헥사(6)코어 / 12쓰레드 / 기본 클럭: 3.9GHz / 최대 클럭: 4.4GHz / L3 캐시: 16MB / TDP: 65W / PCIe3.0 / 메모리 규격: DDR4 / 내장그래픽 : 탑재 / Wraith Stealth 포함 / AM4', '[AMD] 라이젠5 세잔 5600G', 157990, 'cpu'),
